```solidity
pragma solidity ^0.5.0;

contract TokenContract {
    address public owner;
    address public newowner;
    uint256 public supply;
    uint256 public tokenprice;
    mapping(address => uint256) public balanceOf;
    mapping(address => mapping(address => uint256)) public allowance;

    constructor() public payable {
        owner = msg.sender;
        supply = 0x409f9cbc7c4a04c220000000;
        tokenprice = 0xba43b7400;
        if (msg.value == 0) {
            owner = msg.sender;
        }
    }

    function acceptOwnership(address _newowner) public {
        require(msg.sender == owner);
        newowner = _newowner;
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        return true;
    }

    function transferOwnership(address _newowner) public {
        require(msg.sender == owner);
        newowner = _newowner;
    }

    function endICO() public {
        require(msg.sender == owner);
        require(address(this).balance <= balanceOf[msg.sender]);
        balanceOf[msg.sender] -= address(this).balance;
        msg.sender.transfer(address(this).balance);
    }

    function () external payable {
        require(msg.value >= tokenprice);
        uint256 amount = msg.value / tokenprice;
        require(balanceOf[address(this)] >= amount);
        balanceOf[msg.sender] += amount;
        balanceOf[address(this)] -= amount;
    }

    function burn(uint256 _value) public returns (bool success) {
        require(balanceOf[msg.sender] >= _value);
        balanceOf[msg.sender] -= _value;
        supply -= _value;
        return true;
    }

    function BuyTokens() public payable {
        require(msg.value >= tokenprice);
        uint256 amount = msg.value / tokenprice;
        require(balanceOf[address(this)] >= amount);
        balanceOf[msg.sender] += amount;
        balanceOf[address(this)] -= amount;
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(balanceOf[msg.sender] >= _value);
        require(_to != address(0));
        balanceOf[msg.sender] -= _value;
        balanceOf[_to] += _value;
        return true;
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(_value <= balanceOf[_from]);
        require(_value <= allowance[_from][_to]);
        balanceOf[_from] -= _value;
        balanceOf[_to] += _value;
        allowance[_from][_to] -= _value;
        return true;
    }
}
```
This code is a simplified version of a token contract in Solidity. It includes a constructor that sets the initial supply and token price, a transfer function that moves tokens from the sender's account to a specified address, an approve function that allows a certain account to spend a specific amount of tokens on behalf of the sender, and a transferFrom function that moves tokens from one account to another, provided the transaction has been approved. Furthermore, it includes a function to end the ICO by transferring all remaining tokens to the owner, a function to burn tokens by removing them from the supply, and a fallback function that allows anyone to buy tokens by sending ether to the contract. The function BuyTokens allows the purchase of tokens.
